import React from 'react';
import {Link} from 'react-router-dom';
import './Header.scss';

const Header=()=>(
    <div className='header'>
        <Link to=''>
            {/* <Logo className='logo'/> */}
        </Link>
        <div className='options'>
            <Link className='option' to='/shop'>SHOP</Link>
            <Link className='option' to='/'>CNOTACT</Link>
        </div>
    </div>
)
export default Header;
